      // body: "Trận Điện Biên Phủ (tiếng Pháp: Bataille de Diên Biên Phu; phát âm: [bataj də djɛ̃ bjɛ̃ fy]), còn gọi là Chiến dịch Trần Đình là trận đánh lớn nhất[6] trong Chiến tranh Đông Dương lần thứ nhất diễn ra tại lòng chảo Mường Thanh, châu Điện Biên, tỉnh Lai Châu (nay thuộc thành phố Điện Biên Phủ, tỉnh Điện Biên) giữa Quân đội Nhân dân Việt Nam và Quân đội Liên hiệp Pháp (gồm Lực lượng Viễn chinh Pháp, Binh đoàn Lê dương Pháp, phụ lực quân bản xứ và Quân đội Quốc gia Việt Nam).Đây là chiến thắng quân sự lớn nhất trong cuộc Chiến tranh Đông Dương (1945 – 1954) của Việt Nam. Với thắng lợi quyết định này, lực lượng Quân đội Nhân dân Việt Nam do Đại tướng Võ Nguyên Giáp chỉ huy đã buộc quân Pháp tại Điện Biên Phủ phải đầu hàng vào tháng 5 năm 1954, sau suốt 2 tháng chịu trận.[7] Giữa trận này, quân Pháp đã gia tăng lên đến 16.200 người nhưng vẫn không thể cầm cự được trước các đợt tấn công như vũ bão của Quân đội Nhân dân Việt Nam.[8] Thực dân Pháp đã không thể bình định Việt Nam bất chấp sau nhiều năm chiến đấu và với sự hỗ trợ và can dự ngày càng sâu sắc của Hoa Kỳ.[8] Pháp đã không còn bất kì khả năng nào để tiếp tục chiến đấu tại Việt Nam sau thảm bại này.[9]. Trên phương diện quốc tế, chiến dịch này có một ý nghĩa rất lớn và đã đi vào lịch sử nhân loại, bởi đây là lần đầu tiên quân đội của một nước từng là thuộc địa ở châu Á đánh bại đội quân hiện đại và tối tân của một cường quốc châu Âu, được hỗ trợ bởi đồng minh là Mỹ trong một chiến dịch quân sự lớn. Được xem là một thảm họa bất ngờ đối với Thực dân Pháp và cũng là một đòn giáng mạnh với thế giới phương Tây,[7] đã đánh bại ý chí duy trì thuộc địa Đông Dương của Pháp và buộc nước này phải hòa đàm[7] và rút ra khỏi Đông Dương. Với niềm tin được cổ vũ mạnh mẽ bởi chiến thắng này, các thuộc địa của Pháp ở châu Phi cũng đồng loạt nổi dậy. Chỉ riêng trong năm 1960, 17 nước châu Phi đã giành được độc lập và đến năm 1967, Pháp đã buộc phải trao trả độc lập cho hầu hết các nước từng là thuộc địa của họ. Qua đó, thắng lợi của Quân đội Nhân dân Việt Nam trong Chiến dịch Điện Biên Phủ còn được xem là một cột mốc đánh dấu thất bại hoàn toàn của Pháp trong nỗ lực tái gây dựng thuộc địa Đông Dương nói riêng và đế quốc thực dân của họ nói chung sau Chiến tranh thế giới thứ hai,[8][10] qua đó góp phần chấm dứt hơn 400 năm tồn tại của chủ nghĩa thực dân cũ trên thế giới. Trận Điện Biên Phủ (tiếng Pháp: Bataille de Diên Biên Phu; phát âm: [bataj də djɛ̃ bjɛ̃ fy]), còn gọi là Chiến dịch Trần Đình là trận đánh lớn nhất[6] trong Chiến tranh Đông Dương lần thứ nhất diễn ra tại lòng chảo Mường Thanh, châu Điện Biên, tỉnh Lai Châu (nay thuộc thành phố Điện Biên Phủ, tỉnh Điện Biên) giữa Quân đội Nhân dân Việt Nam và Quân đội Liên hiệp Pháp (gồm Lực lượng Viễn chinh Pháp, Binh đoàn Lê dương Pháp, phụ lực quân bản xứ và Quân đội Quốc gia Việt Nam).Đây là chiến thắng quân sự lớn nhất trong cuộc Chiến tranh Đông Dương (1945 – 1954) của Việt Nam. Với thắng lợi quyết định này, lực lượng Quân đội Nhân dân Việt Nam do Đại tướng Võ Nguyên Giáp chỉ huy đã buộc quân Pháp tại Điện Biên Phủ phải đầu hàng vào tháng 5 năm 1954, sau suốt 2 tháng chịu trận.[7] Giữa trận này, quân Pháp đã gia tăng lên đến 16.200 người nhưng vẫn không thể cầm cự được trước các đợt tấn công như vũ bão của Quân đội Nhân dân Việt Nam.[8] Thực dân Pháp đã không thể bình định Việt Nam bất chấp sau nhiều năm chiến đấu và với sự hỗ trợ và can dự ngày càng sâu sắc của Hoa Kỳ.[8] Pháp đã không còn bất kì khả năng nào để tiếp tục chiến đấu tại Việt Nam sau thảm bại này.[9]. Trên phương diện quốc tế, chiến dịch này có một ý nghĩa rất lớn và đã đi vào lịch sử nhân loại, bởi đây là lần đầu tiên quân đội của một nước từng là thuộc địa ở châu Á đánh bại đội quân hiện đại và tối tân của một cường quốc châu Âu, được hỗ trợ bởi đồng minh là Mỹ trong một chiến dịch quân sự lớn. Được xem là một thảm họa bất ngờ đối với Thực dân Pháp và cũng là một đòn giáng mạnh với thế giới phương Tây,[7] đã đánh bại ý chí duy trì thuộc địa Đông Dương của 